import React, { useState } from "react";
import {
  Flex,
  ActionIcon,
} from "@mantine/core";
import {
  IconHome2,
  IconUser,
  IconSearch,
  IconMessageCircle,
  IconShoppingBag,
  IconBookmark,
} from "@tabler/icons-react";

const icons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconSearch", component: <IconSearch /> },
  { name: "IconShoppingBag", component: <IconShoppingBag /> },
  { name: "IconUser", component: <IconUser /> },
];
const blackicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];
const redicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];

const navbaritem = {
  flex1:(
    <Flex
    mih={40}
    bg="dark.9"
    justify="space-around"
    align="center"
    direction="row"
    wrap="wrap"
    style={{ border: "1px solid #1b1c1b" }}
  >
    {blackicons.map((blackicon, index) => (
      <ActionIcon
        bg="black"
        radius="md"
        key={index}
        aria-label={`Icon ${blackicon.component}`}
      >
        {blackicon.component}
      </ActionIcon>
    ))}
  </Flex>
  ),
  flex2: (
    <Flex
      mih={40}
      bg="white"
      mt="xs"
      justify="space-around"
      align="center"
      direction="row"
      wrap="wrap"
      style={{ border: "1px solid #1b1c1b" }}
    >
      {redicons.map((redicon, index) => (
        <ActionIcon
          color="red"
          radius="md"
          key={index}
          aria-label={`Icon ${redicon.component}`}
        >
          {redicon.component}
        </ActionIcon>
      ))}
    </Flex>
  ),
  flex3: (
    <Flex
    mih={40}
    mt="xs"
    bg="white"
    justify="space-around"
    align="center"
    direction="row"
    wrap="wrap"
    style={{ border: "1px solid #1b1c1b" }}
  >
    {icons.map((icon, index) => (
      <ActionIcon radius="xl" key={index} aria-label={`Icon ${icon.component}`}>
        {icon.component}
      </ActionIcon>
    ))}
  </Flex>
  ),
};

const Navbar = ({
  Item,
  SetItem,
  Item2,
  setItem2,
  Item3,
  setItem3,
  navBar,
}) => {
  const handleStack1Click = () => {
    SetItem(!Item);
    navBar(navbaritem.flex1);
  };

  const handleStack2Click = () => {
    setItem2(!Item2);
    navBar(navbaritem.flex2);
  };

  const handleStack3Click = () => {
    setItem3(!Item3);
    navBar(navbaritem.flex3);
  };
  const [selectedIcon, setSelectedIcon] = useState(null);
  const [selectedBlackIcon, setSelectedBlackIcon] = useState(null);
  const [selectedRedIcon, setSelectedRedIcon] = useState(null);

  const handleIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedIcon(index);
  };

  const handleBlackIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedBlackIcon(index);
  };

  const handleRedIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedRedIcon(index);
  };

  const icons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconSearch", component: <IconSearch /> },
    { name: "IconShoppingBag", component: <IconShoppingBag /> },
    { name: "IconUser", component: <IconUser /> },
  ];
  const blackicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];
  const redicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  // select for phone

  return (
    <>
      {/* <Flex
        mih={40}
        bg="dark.9"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b" }}
        onClick={handleStack1Click}
      >
        {blackicons.map((blackicon, index) => (
          <ActionIcon
            bg="black"
            radius="md"
            key={index}
            variant={selectedBlackIcon === index ? "transparent" : ""}
            aria-label={`Icon ${blackicon.component}`}
            onClick={() => handleBlackIconClick(index, blackicon)}
          >
            {blackicon.component}
          </ActionIcon>
        ))}
      </Flex>

      <Flex
        mih={40}
        bg="white"
        mt="xs"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b" }}
        onClick={handleStack2Click}
      >
        {redicons.map((redicon, index) => (
          <ActionIcon
            color="red"
            radius="md"
            key={index}
            // variant={selectedRedIcon === index ? "" : "transparent"}
            aria-label={`Icon ${redicon.component}`}
            onClick={() => handleRedIconClick(index, redicon)}
          >
            {redicon.component}
          </ActionIcon>
        ))}
      </Flex>

      <Flex
        mih={40}
        mt="xs"
        bg="white"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b" }}
        onClick={handleStack3Click}
      >
        {icons.map((icon, index) => (
          <ActionIcon
            radius="xl"
            key={index}
            variant={selectedIcon === index ? "outline" : "default"}
            aria-label={`Icon ${icon.component}`}
            onClick={() => handleIconClick(index, icon)}
          >
            {icon.component}
          </ActionIcon>
        ))}
      </Flex> */}
      
    </>
  );
};

export default Navbar;
